import React from 'react';
import { Page, Document, Image, StyleSheet } from '@react-pdf/renderer';
// import InvoiceTitle from './InvoiceTitle'
// import BillTo from './BillTo'
// import InvoiceNo from './InvoiceNo'
// import InvoiceItemsTable from './InvoiceItemsTable'
// import InvoiceThankYouMsg from './InvoiceThankYouMsg'
import LetterHead from '../.././src/assets/MSMHeader.png'
import LetterFoot from '../.././src/assets/MSMFooter.png'
import InvoiceItemsTable from './InvoiceItemsTable';


const styles = StyleSheet.create({
    page: {
        fontFamily: 'Helvetica',
        fontSize: 11,
        paddingTop: 20,
        paddingLeft: 50,
        paddingRight: 50,
        lineHeight: 2,
        flexDirection: 'column',
    },
    Head: {
        width: 550,
        height: 70,
        marginLeft: 'auto',
        marginRight: 'auto'
    },
    Foot: {
        paddingTop: 20,
        width: 500,
        height: 70,
        marginLeft: 'auto',
        marginRight: 'auto'
    }
});



const Invoice = (invoice) => (

    <Document>

        {(() => {
            let NumberofPage = invoice.items.length / 25

            for (let i = 0; i < NumberofPage; i++) {
                <Page size="A4" style={styles.page}>
                    <Image style={styles.Head} src={LetterHead} />

                    <InvoiceItemsTable invoice={invoice} />

                    <Image style={styles.Foot} src={LetterFoot} />
                </Page>
            }

        })()}

    </Document>
)




export default Invoice
